import React from 'react';
import WorkoutItem from '../WorkoutItem/WorkoutItem'; // Renamed from WorkoutList
import './WorkoutGrid.css'; // Styles for the grid layout

const WorkoutGrid = ({ templates }) => {
  return (
    <div id='workout-grid'>
      {templates.map(template => (
        <WorkoutItem
          key={template.workout_id}
          name={template.workout_name}
          day_type={template.workout_day_type}
          plan_type={template.plan_type}
          difficulty_level={template.difficulty_level}
        />
      ))}
    </div>
  );
};

export default WorkoutGrid;
